<script>

$( document ).ready(function() {
  
    
    $('.dialog').dialog({
      modal: true,
      buttons: {
        Ok: function() {
          $( this ).dialog( "close" );
          for(let i = 0; i < 45; i++) {
          $(`#bed${i}`).fadeOut("slow").delay(Math.floor(Math.random() * 600) + 1).fadeIn("slow");
          }
        }
      }
    });
          for(let i = 0; i < 45; i++) {
            
            $(`#bed${i}`).click(function() {
                window.location.href = `/gardener/${i}`;
            });       
          }

    });

</script>
